        <Route path='/post-ad' exact>
          <Postad />
        </Route>
      </Switch>
      </header>
      <div>
        <Horizontalbar />
      </div>
      <main>
        <Mainbody />
      </main>
      <footer>
        <Footer />
      </footer>
    </div>

  );
}

export default App;
